        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](123, "Le Cyber Security Challenge est une comp\u00E9tition de cyber s\u00E9curit\u00E9 comme son nom l'indique, et consiste en un \"Capture the Flag\", ayant comme but de trouver un \"flag\" confirmant la r\u00E9ussite de l'\u00E9preuve au terme d'une \u00E9nigme plus ou moins longue. Ayant eu l'occasion de participer aux 3 \u00E9ditions propos\u00E9es durant mon cursus \u00E0 l'EPHEC, j'ai pu apprendre \u00E9norm\u00E9ment de choses gr\u00E2ce \u00E0 ce challenge. Tout d'abord, celui-ci proposant des \u00E9preuves extr\u00E8mement diverses et vari\u00E9es, allant de la s\u00E9curit\u00E9 des r\u00E9seaux \u00E0 la logique math\u00E9matique, en passant par la programmation, le traitement des signaux, les connaissances de Linux et j'en passe, c'est vraiment tr\u00E8s enrichissant sur tous les domaines, car nous sommes oblig\u00E9s de creuser, d'en apprendre toujours plus pour faire face \u00E0 l'\u00E9preuve avec un maximum d'efficacit\u00E9. De base, je m'\u00E9tais inscrit au CSC en 1\u00E8re ann\u00E9e, en ayant tr\u00E8s peu d'ambition au vu de mes faibles connaissances en informatique, mais finalement c'\u00E9tait tellement vari\u00E9, accessible \u00E0 tout le monde et ludique que je me suis pris au jeu et j'y ai particip\u00E9 les 3 ann\u00E9es en finissant toujours avec une grande fiert\u00E9, bien que n'\u00E9tant pas all\u00E9 en finale.");
