        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](125, "Cette comp\u00E9tition a donc \u00E9t\u00E9, comme je l'ai dit plus haut, extr\u00E8mement enrichissante dans beaucoup de domaines. Chaque \u00E9dition durant 32 heures (de 10h un jour \u00E0 18h le lendemain), c'est une des \u00E9preuves pour laquelle je me suis le plus investi, faisant \u00E0 chaque fois des nuits assez courtes pour valoriser chaque minute, qui peut \u00EAtre crusciale au terme de ces 32 heures. J'aimerais d'ailleurs pouvoir y participer \u00E0 nouveau, que ce soit le CSC en tant que tel, ou une activit\u00E9 similaire. J'avais effectivement d\u00E9j\u00E0 particip\u00E9 \u00E0 des Capture the Flag en ligne, ce qui m'a bien pr\u00E9par\u00E9 au Cyber Security Challenge, mais ce sont souvent des \u00E9preuves mondiales, ouvertes \u00E0 tous, donc en tant qu'\u00E9tudiants, nous avons que tr\u00E8s peu de chances d'arriver \u00E0 un bon classement. Si l'opportunit\u00E9 se pr\u00E9sente \u00E0 nouveau, je la prendrai donc bien \u00E9videment.");
