        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](155, "Entre septembre 2017 et juin 2019, j'ai eu l'occasion de participer aux Cadets du Feu (ou Cadets Pompiers), une formation propos\u00E9e entre autres par les pompiers de la province de Li\u00E8ge. Cette formation trouve excellement bien sa place au vu de mon projet professionnel, je suis donc fier de la valoriser dans ce portfolio. Bien que cette formation sois - bien \u00E9videment - beaucoup plus ax\u00E9e sur le m\u00E9tier de pompier, j'ai ici d\u00E9cid\u00E9 de valoriser le chapitre sur la t\u00E9l\u00E9communication ASTRID, ceci \u00E9tant intimement li\u00E9 au cours de T\u00E9l\u00E9communication que j'ai eu \u00E0 l'EPHEC avec Mr Bouterfa. La t\u00E9l\u00E9communication ASTRID consiste en la communication radio utilis\u00E9e sur les interventions, ne d\u00E9pendant pas du r\u00E9seau t\u00E9l\u00E9phonique, et donc \u00E9tant totalement ind\u00E9pendant. Ce chapitre sur ASTRID, s'est donn\u00E9 durant 12 heures, comprenant un cours th\u00E9orique pour apprendre les concepts derri\u00E8re cette t\u00E9l\u00E9communication, et ensuite un cours pratique pour apprendre \u00E0 utiliser ces radios. En dehors de ce chapitre, nous avons bien \u00E9videment encore utilis\u00E9 ces radios, pour encore quelques dizaines d'heures lors de l'apprentissage de la lutte contre l'incendie.");
